import {ReactComponent as StarFull} from 'assets/img/star-full'
import {ReactComponent as StarHalf} from 'assets/img/star-half'
import {ReactComponent as StarEmpty} from 'assets/img/star-empty'

function MovieStar() {

    return (
        <div className="dsmovie-stars-container">
            <StarFull />
            <StarFull />
            <StarFull />
            <StarHalf />
            <StarEmpty />
        </div>
    )
}

export default MovieStar;
